import { BrowserRouter, Route } from "react-router-dom"
import App from "./App"
import { Provider } from 'react-redux';

const Root = ({ store }) => {
  return (
    <Provider store={store}>
      <BrowserRouter>
        <Route path='/' element={<App />} />
      </BrowserRouter>
    </Provider>
  )
}

export default Root;
